import React from "react";
import { useContext } from "react";
import { DogContext } from "../Context/ContextProvider";
import "./Dogs.css";

const DogsPage = () => {
  const { dogs } = useContext(DogContext);

  return (
    <div>
      <section className="dogs">
        <div className="row">
          {dogs &&
            dogs.map((dog) => {
              return (
                <div key={dog.id} className="card">
                  <div className="dogs-img-container">
                    <img
                      className="card-img-top dog-img"
                      src={dog.imageUrl}
                      alt={dog.name}
                    />
                  </div>
                  <div className="card-body dogs-info">
                    <h4 className="card-title">{dog.name}</h4>
                    <p className="card-text dogs-des">{dog.description}</p>
                    <p className="card-text dogs-price">{dog.price}</p>
                    <button className="dogs-btn">Add to Cart</button>
                  </div>
                </div>
              );
            })}
        </div>
      </section>
    </div>
  );
};

export default DogsPage;
